import React, { useEffect, useState } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import { Typewriter } from 'react-simple-typewriter';

function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  useEffect(() => {
    AOS.init({ duration: 1000, once: true });
  }, []);

  const navLinks = ['overview', 'gallery', 'brochure', 'sitemap', 'contact'];

  return (
    <>
      {/* Fonts */}
      <link
        href="https://fonts.googleapis.com/css2?family=Playfair+Display:wght@400;700&family=Inter:wght@300;400;500&display=swap"
        rel="stylesheet"
      />

      {/* Navbar */}
      <header className="w-full fixed top-0 left-0 z-50 bg-[#0e0e0e] text-white shadow-md border-b border-[#1e1e1e]">
        <div className="max-w-7xl mx-auto flex items-center justify-between px-4 py-4 md:px-6">
          {/* Logo */}
          <div className="flex items-center">
            <img
              src="/logo-trans.png"
              alt="Assotech Windsor Group"
              className="h-10 md:h-12 w-auto object-contain brightness-0 invert"
            />
          </div>

          {/* Desktop Nav */}
          <nav className="hidden md:flex items-center space-x-8 font-semibold text-sm uppercase tracking-wide">
            {navLinks.map(link => (
              <a key={link} href={`#${link}`} className="hover:text-[#fcbf49] transition">
                {link.charAt(0).toUpperCase() + link.slice(1)}
              </a>
            ))}
            <div className="text-right hidden lg:block">
              <div className="text-xs text-gray-400">Call Us Today!</div>
              <div className="font-bold text-white">+91-75661-55505</div>
            </div>
            <a
              href="https://wa.me/917566155505"
              target="_blank"
              rel="noreferrer"
              className="bg-[#fcbf49] hover:bg-yellow-400 text-black font-bold py-2 px-4 rounded"
            >
              ðŸ“ž Contact Us
            </a>
          </nav>

          {/* Mobile Toggle */}
          <button
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            className="md:hidden focus:outline-none text-white"
          >
            â˜°
          </button>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="md:hidden bg-[#0e0e0e] border-t border-[#1e1e1e] px-4 pb-4">
            {navLinks.map(link => (
              <a
                key={link}
                href={`#${link}`}
                className="block py-2 text-sm uppercase hover:text-[#fcbf49]"
                onClick={() => setIsMenuOpen(false)}
              >
                {link.charAt(0).toUpperCase() + link.slice(1)}
              </a>
            ))}
            <div className="mt-4">
              <a
                href="https://wa.me/917566155505"
                target="_blank"
                rel="noreferrer"
                className="block bg-[#fcbf49] text-black font-bold text-center py-2 rounded hover:bg-yellow-400 transition"
              >
                ðŸ“ž Contact Us
              </a>
            </div>
          </div>
        )}
      </header>

      {/* Hero */}
      <div className="relative text-white font-sans min-h-screen pt-20 overflow-x-hidden">
        <img src="/hero.jpg" alt="hero" className="absolute w-full h-full object-cover z-0" />
        <div className="absolute inset-0 bg-black/70 z-10"></div>
        <div className="relative z-20 flex flex-col items-center justify-center min-h-screen text-center px-4" data-aos="fade-up">
          <h1 className="text-4xl sm:text-5xl md:text-6xl font-bold mb-4" style={{ fontFamily: "'Playfair Display', serif" }}>
            Windsor Heights, Katni
          </h1>
          <h2 className="text-lg sm:text-xl md:text-2xl font-light max-w-2xl text-gray-200">
            <Typewriter
              words={[
                'Premium LIG & MIG Township',
                'Under PMAY AHP â€“ Jhinjhri, Katni',
                'Modern Living. Government Support.',
              ]}
              loop={0}
              cursor
              cursorStyle="|"
              typeSpeed={60}
              deleteSpeed={40}
              delaySpeed={1500}
            />
          </h2>
          <a
            href="#contact"
            className="mt-10 bg-[#fcbf49] text-black font-semibold px-6 py-3 rounded hover:bg-yellow-400 transition"
          >
            Book a Site Visit
          </a>
        </div>
      </div>

      {/* Other Sections */}
      {/* Keep the rest of your sections as-is: Overview, Why Choose, Gallery, Brochure, Sitemap, Contact, Footer */}
      {/* All your responsive classes (like md:grid-cols-2, px-4, max-w-6xl mx-auto) will automatically adapt for mobile */}

    </>
  );
}

export default App;
